import React from 'react';
import "../styles/Carousel.css";
function Carousel() {
    return (
        <div className="carousel">
            <img src="slide1.jpg" alt="Slide 1" />
            <img src="slide2.jpg" alt="Slide 2" />
            <img src="slide3.jpg" alt="Slide 3" />
        </div>
    );
}

export default Carousel;
